import React from 'react'
import BooksGrid from './BooksGrid';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import {Typography,Button, AppBar ,  CssBaseline ,Toolbar ,Container} from '@mui/material'
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import {Tabs, Tab} from '@mui/material'
import FinishedBooks from './FinishedBooks';
import Footer from './Footer';
import logo from './atoms/images/logo.png';
import Image from './atoms/Image'
import User from './atoms/User'
import { makeStyles } from '@mui/styles';
import Icons from './atoms/Icons';
import Text from './atoms/Text';

const useStyles = makeStyles(theme => ({
  avatar: {
    position: 'absolute',
    left:'75%',
     },
  arrow:{
    color: 'black',
    position: 'absolute',
    left:'74.69%'
  },
  search:{color: 'black',
    position: 'absolute',
    left: '23.69%',
    right: '7.03%',
    top: '34.88%',
    bottom: '7.03%'},
  logo:{position: 'absolute',
    left: '17.36%',
    right: '74.02%',
    top: '34.88%',
    bottom: '34.88%'
  },
explore:{
    color: 'black',
    position: 'absolute',
    fontSize: '16px',
    fontStyle: 'normal',
    fontWeight: '500',
    lineHeight: '20px',
    letterSpacing: '0em',
    textAlign: 'left',
    left:'28.69%'
},
myLib:{
  color: 'black',
      position: 'absolute',
      left:'35.69%',
      fontSize: '16px',
      fontStyle: 'normal',
      fontWeight: '500',
      lineHeight: '20px',
      letterSpacing: '0em',
      textAlign: 'left'
}
})); 

function App(){
  const [value,setValue]= React.useState(0)
  const classes=useStyles()
  const handleTabs=(e:React.SyntheticEvent<Element, Event> , val: number)=>{
          console.log(val)
          setValue(val)
  }

  return (
    <>
    <CssBaseline />
    <AppBar  style={{ background: '#FFFFFF'}} position='relative'>
      <Toolbar>
      <Image className={classes.logo} path={logo} />
      <Icons className={classes.search}>
      <SearchOutlinedIcon/>
      </Icons>

     <Text className={classes.explore} variant='body1' content='Explore'/>

      <KeyboardArrowDownIcon style={{ color: 'black',
      position: 'absolute',
      left:'31.69%',}}/>

      <Text className={classes.myLib} variant='body1' content='My Library'/>


      <User className={classes.avatar}  username="B" />

      <Icons className={classes.arrow}>
        <KeyboardArrowDownIcon />
      </Icons>

      </Toolbar>
    </AppBar>

    <main>
        <Container maxWidth="lg">
        <Typography variant="h6" style={{
      fontSize: '36px',
      lineHeight: '45px',
      fontStyle: 'normal',
     marginLeft:'15%'}} align="left" color="black" gutterBottom>
          My Library
        </Typography>
        </Container>
    </main>

    <Tabs value={value} onChange={handleTabs} style={{marginLeft:"25%",color:'green'}}>
      <Tab label="Currently reading" style={{textTransform:"none",width:"304px",fontWeight:700,fontSize:18}}/>
      <Tab label="Finished" style={{textTransform:"none",width:"304px",fontWeight:700,fontSize:18}}/>
    </Tabs>
    <TabPanel value={value} index={0}><BooksGrid/></TabPanel>
    <TabPanel value={value} index={1}><FinishedBooks/></TabPanel>

   {/*  <Image path={logo}/>
        <Cards  imag={one} name="Bring Your Human to Work" author="Erica Keswin" duration="13"/>
   */}
    <Footer />
    </>
  );
}

const TabPanel:React.FunctionComponent<{value:number, index:number}>=(props)=>
{
  const {children, value, index} =props
  return (
    <div>
      <h1>
      { value === index && (
        <h1>{children} </h1>
      )}
      </h1>
    </div>
  );
} 
export default App;
